INSERT INTO `m_pressrelease` VALUES (1,'Announcing The Say Foundation-Yunikee Partnership','press-slug',NULL,'Announcing The Say Foundation-Yunikee Partnership Announcing The Say Foundation-Yunikee Partnership Announcing The Say Foundation-Yunikee Partnership Announcing The Say Foundation-Yunikee Partnership Announcing The Say Foundation-Yunikee PartnershipAnnouncing The Say Foundation-Yunikee Partnership','2023-03-23 00:00:00',NULL,'Internet',1,'2021-03-22 18:30:00',0,'2021-03-23 00:00:00',0,0),(2,'Lorem ipsum text','slug-slug11',NULL,'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.','2023-04-13 19:10:00',NULL,'Zee News',1,'2023-02-22 18:30:00',0,'2023-02-23 00:00:00',0,0),(3,'Demo','demo',NULL,'ugreiubgiuebgiug ei rgbeigr     ei','2023-04-03 19:10:00',NULL,'Ajjtak',1,'2023-04-10 13:40:00',0,'2023-04-10 19:10:00',0,0),(4,'Title Name','title-name','pressRelease1681416872.jpg','&lt;p&gt;Details&amp;nbsp;&lt;/p&gt;','2023-04-14 05:00:00','Posted By',NULL,1,'2023-04-13 20:14:32',0,NULL,0,0),(5,'CSM Group promotes Sidhartha Mishra  to a co-CEO','csm-group-promotes-sidhartha-mishra--to-a-co-ceo','pressRelease1682486767.jpg','&lt;p&gt;CSM Group is pleased to announce that Paul Coury has been promoted to Senior Project Manager.&lt;/p&gt;\r\n\r\n&lt;p&gt;Coury is a highly experienced engineering manager with a broad range of expertise in manufacturing, product development, product transfers, and FDA-regulated industries.&amp;nbsp;Over his 40-year career, Coury has managed and executed capital projects for many clients across the Midwest, including multinational pharmaceutical and biotechnology companies.&lt;/p&gt;\r\n\r\n&lt;p&gt;Since he joined CSM Group in February of 2021, Coury has been supporting a confidential client&amp;#39;s largest capital projects.&lt;/p&gt;\r\n\r\n&lt;blockquote&gt;\r\n&lt;p&gt;&amp;quot;Paul has established himself as a valued resource on one of [our client&amp;#39;s] largest capital projects in a relatively short time,&amp;quot; said Will Buttars, Program Executive.&amp;nbsp;&amp;quot;He provides industry knowledge and experience that is leveraged to great effect amongst both his team and the client. His prior experience managing departments of project engineers and SMEs has equipped him to transition into this new role seamlessly and successfully. We look forward to the knowledge and leadership Paul will add to this project and client for years to come.&amp;quot;&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n\r\n&lt;p&gt;As a Senior Project Manager, he will be responsible for providing leadership, direction, and oversight during all phases of construction. He will act in the best interest of the organization by establishing quality relationships with CSM Group&amp;rsquo;s project managers and will act as an industry expert to assist project managers in all facets of construction, safety, and CSM Group procedures.&lt;/p&gt;','2023-04-15 11:00:00','2023/04/15 11:00',NULL,0,'2023-04-13 20:16:01',0,'2023-04-26 10:56:07',1,0),(6,'testingTwo','testingtwo','pressRelease1681417005.jpg','&lt;p&gt;testingTwo&lt;/p&gt;','2023-04-14 05:00:00','testingTwo',NULL,0,'2023-04-13 20:16:45',0,NULL,1,1),(9,'Your Availability for an Interview With a Journalist is a One-Shot Chance; why Would you Jeopardize','your-availability-for-an-interview-with-a-journalist-is-a-one-shot-chance-why-would-you-jeopardize-','pressRelease1682486295.jpg','&lt;p&gt;You take the time to research a decent press release service. You might go so far as to look up a&amp;nbsp;&lt;a href=&quot;https://www.24-7pressrelease.com/press_release_writing&quot; target=&quot;_blank&quot;&gt;press release writing service&lt;/a&gt;. You then pay a premium to have a company (like 24-7 Press Release Newswire) distribute your press release. Your press release gets distributed to the media, and you either leave your phone off or don&amp;#39;t answer it. As ludicrous as this sounds, we&amp;#39;ve heard of the aftermath of such stories.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Unless you have a 110% valid excuse (see below), you do not have an excuse to &amp;#39;blow off the media because you cannot afford the time.&amp;#39;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;When you distribute a press release to the media, ensure you have, at the very minimum, one contact available for media requests. If you are a sole proprietor, it&amp;#39;s a good possibility you are the only contact. Ensure your media contact is also placed in your press release&amp;#39;s body (at the bottom).&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;It is great to have your media contact information available, but what is the point if you don&amp;#39;t answer your phone? Do not pitch the media and let your phone go to voice mail. The media are under deadlines and need commitment and information yesterday.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you&amp;#39;re in a meeting, excuse yourself. If you&amp;#39;re indisposed, answer it discretely. If you&amp;#39;re in your car, use Bluetooth or pull over in a safe spot and answer it!&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Not answering or not immediately getting back to a journalist or not participating in an interview is the worst thing you could do, as these opportunities are few and far between.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;What is a valid excuse for not taking a call from the media?&lt;br /&gt;\r\nIf you&amp;#39;re boarding a plane and unable to do an interview, this could be a valid excuse. This situation is where having a backup contact would help. Besides, you shouldn&amp;#39;t be sending a news release knowing that you will not be able to field the calls.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please take the opportunity when it presents itself. Help the media help you.&lt;/p&gt;','2023-04-26 10:00:00','Kim Hyun-joong','south korea',0,'2023-04-26 05:18:15',1,NULL,0,0),(10,'30% Vacant Buildings in Haltom City\'s Main Corridor Do Attract Crime',NULL,'pressRelease1682486444.jpg','&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;HALTOM CITY, TX, April 25, 2023&amp;nbsp;&lt;strong&gt;/24-7PressRelease/&lt;/strong&gt;&amp;nbsp;-- A simple Google search asking &amp;quot;Do vacant buildings attract crime?&amp;quot; makes it clear. Study after study has found that crime increases substantially when property is allowed to remain vacant or abandoned in inner city areas.&lt;br /&gt;\r\n&lt;br /&gt;\r\nIn the South and Central neighborhoods of Haltom City, this issue needs attention now. A recent business census showed that Haltom City&amp;#39;s US 377 corridor has a whopping 29% vacancy rate in the area from NE Loop 820 to Belknap. Additionally, inner city neighborhoods that were once known for their balance of homes and businesses are experiencing an increase in vacant buildings and a corresponding rise in drugs, theft and other criminal activity, according to multiple comments on Facebook from Haltom City citizens. To be fair, one resident, Jayson Steele, who is also a city employee reporting directly to the city manager, noted that he did not believe that vacant buildings led to increased crime.&lt;br /&gt;\r\n&lt;br /&gt;\r\nAccording to the&amp;nbsp;&lt;a href=&quot;https://www.facebook.com/HaltomUnitedBusinessAllianceHUBA&quot; target=&quot;_blank&quot;&gt;Haltom United Business Alliance&lt;/a&gt;&amp;nbsp;(HUBA), city leadership should work urgently for the revitalization of South and Central Haltom and recognize the connection between empty buildings and crime. Charlie Roberts, a candidate for City Council Place 1, said, &amp;quot;My eyes see the vacancies, and I don&amp;#39;t need a study to know that the corridor has been in decline for some time. I want to make sure the council takes this seriously and makes a plan ASAP to bring in more small businesses.&amp;quot; He added, &amp;quot;We also want the additional taxes, jobs, products and services more businesses will certainly bring.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\nThere are many cities around the country that have already had success in abating crime by dealing with vacant properties. For example, the&amp;nbsp;&lt;a href=&quot;https://assets.dmagstatic.com/wp-content/uploads/2020/01/Mayors-Task-Force-on-Safe-Communities-2019-Report-FINAL-FORMEDIADISTRIBUTION2.pdf&quot; target=&quot;_blank&quot;&gt;Mayor&amp;#39;s Task Force on Safe Communities in Dallas&lt;/a&gt;&amp;nbsp;recently met to specifically discuss vacant lots and abandoned buildings in the Mill City neighborhood and submit recommendations based on results seen in other cities across the country. During the meeting, Mayor Eric Johnson pointed out that Dallas had already seen a reduction in crime in places where such efforts had occurred over the past 3 years. Police Chief Eddie Garcia added that these types of efforts help the work of the police as well.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThere is also a wide range of resources available on-line that explore the issues and/or offer suggestions on how to tackle the challenges being faced. If there are any doubts about whether vacant buildings increase crime, here are just two of many that can be found on-line for review:&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe US Department of Justice published a study in the Journal of Criminal Justice that tested the hypothesis &amp;quot;The number of drug, property, and violent crimes is higher on blocks with abandoned residential buildings than on comparable blocks without abandoned buildings.&amp;quot; The study ultimately found that &amp;quot;Crime rates on blocks with open abandoned buildings were twice as high as rates on matched blocks without open buildings.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe Journal of Research in Crime and Delinquency found in a 2019 study&amp;nbsp;&lt;a href=&quot;https://ccjs.umd.edu/sites/ccjs.umd.edu/files/pubs/0022427818807965.pdf&quot; target=&quot;_blank&quot;&gt;Understanding the Criminogenic Properties of Vacant Housing: A Mixed Methods Approach&lt;/a&gt;&amp;nbsp;that abandoned properties attract or generate crime since they are seen as easy targets that provide cover for criminal activity. The study also concluded that &amp;quot;the removal of abandoned housing was associated with positive changes in crime overall.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhen it comes to ideas on how to address the issues at hand, the US Dept. of Housing and Urban Development (HUD) has a resource called&amp;nbsp;&lt;a href=&quot;https://www.huduser.gov/portal/periodicals/em/winter14/highlight1.html&quot; target=&quot;_blank&quot;&gt;Vacant and Abandoned Properties: Turning Liabilities Into Assets&lt;/a&gt;&amp;nbsp;which offers ideas and suggestions and includes a long list of resources (in footnote form) that link to other items of interest.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThere is also Texas Problem Properties Toolkit written by The Community Development Clinic at the University of Texas - School of Law &amp;quot;to help Texas communities address problems created by vacant and abandoned properties.&amp;quot; The toolkit asserts that vacant and abandoned properties &amp;quot;breed dumping, hazardous building conditions, drug activity, and other crimes&amp;quot; and reports that a study in Dallas &amp;quot;found that vacant and other problem properties have lowered property values by approximately $575 million, costing the city $4.3 million a year in lost property taxes.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe ASU Center for Problem-Oriented Policing also has a toolkit of sorts. The Problem of Abandoned Buildings and Lots helps the reader analyze problems in their own city and offers ideas based on &amp;quot;what is known from research, evaluation and government practice.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\nHUBA founder Ron Sturgeon is seriously concerned and says that the situation in Haltom City will only get worse if city leadership fails to act. In 2022, Ron started a movement called&amp;nbsp;&lt;a href=&quot;https://makehaltomcitythriveagain.com/&quot; target=&quot;_blank&quot;&gt;Make Haltom City Thrive Again&lt;/a&gt;&amp;nbsp;to bring attention to the issues and call for city council members who will tackle the challenges faced. He also co-authored the book&amp;nbsp;&lt;a href=&quot;https://www.amazon.com/Keeping-Downtown-Americas-English-Spanish/product-reviews/0985111267/ref=cm_cr_arp_d_paging_btm_next_2?ie=UTF8&amp;amp;reviewerType=all_reviews&amp;amp;pageNumber=2&quot; target=&quot;_blank&quot;&gt;Keeping the Lights on Downtown in America&amp;#39;s Small Cities&lt;/a&gt;&amp;nbsp;(original and 2nd Edition).&lt;br /&gt;\r\n&lt;br /&gt;\r\nAs part of the Make Haltom City Thrive Again campaign, Ron will send a free copy of the book to any Haltom City resident or business owner who requests one. To get a free copy, e-mail your name and address to&amp;nbsp;&lt;a href=&quot;mailto:rons@rdsinvestments.com&quot;&gt;rons@rdsinvestments.com&lt;/a&gt;. Says Ron, &amp;quot;I hope you will join myself and others in this effort to revitalize Haltom City. I am a huge fan of this mighty city, and I want the best for our residents and businesses.&amp;quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;About Haltom United Business Alliance&lt;/strong&gt;&lt;br /&gt;\r\nHaltom United Business Alliance (HUBA) wants to give members of Haltom City&amp;#39;s business community an advocate and to keep those businesses informed about issues that affect them. They want to make sure Haltom City is business friendly and nurtures small business growth, including automotive businesses in the industrial districts, and bring more restaurants including breweries and eventually a major grocery store to the city. New businesses and growth in existing businesses will create a stronger tax base which will allow the city to pay its first responders wages that are competitive with surrounding cities while improving Haltom City&amp;#39;s facilities and infrastructure. HUBA believes that the southern and central parts of the city need a revitalization plan, to prevent further degradation in those areas, and wants that to happen before the inner-city experiences increased crime and more blight. As retail and office uses are in decline, it&amp;#39;s more critical than ever to attract new businesses. They believe that such a plan requires a strong relationship and support of the business community. Anyone who owns a business in Haltom City is eligible to join HUBA. Dues are $20 annually or $50 for a lifetime membership, and membership is 100% confidential. To join, contact Joe Palmer at (682) 310-0591 or by email at&amp;nbsp;&lt;a href=&quot;mailto:HUBAgrp@gmail.com&quot;&gt;HUBAgrp@gmail.com&lt;/a&gt;. Visit the group&amp;#39;s Facebook at Haltom United Business Alliance.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;About Haltom City&lt;/strong&gt;&lt;br /&gt;\r\nHaltom City is a diverse, majority working-class city located between Dallas and Fort Worth in Tarrant County, TX.&amp;nbsp;&lt;a href=&quot;https://en.wikipedia.org/wiki/Haltom_City,_Texas&quot; target=&quot;_blank&quot;&gt;Haltom City&lt;/a&gt;&amp;nbsp;is minutes from both the DFW Airport and Downtown Fort Worth with direct access to major highways including I-820 and SH-121. Due to an outdated and restrictive use matrix that discourages new business and deters growth, several areas of Haltom City have seen a decline in small businesses which provided goods and services and were a significant source of jobs, including the once-thriving automotive industry. However, Haltom City has the opportunity to reverse this trend and should prioritize development of inner-city land and vacant buildings, particularly in the major corridors close to the city&amp;#39;s center. The city is financially healthy with a capable manager and staff who would like to see diverse business development occur and need the support of the City Council to make it happen.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;About Make Haltom City Thrive Again&lt;/strong&gt;&lt;br /&gt;\r\nThe Make Haltom City Thrive Again website offers information and resources about its purpose and goals. For more on Sturgeon&amp;#39;s personal ideas and background, check out his book Keeping the Lights on Downtown in America&amp;#39;s Small Cities and watch the videos on his&amp;nbsp;&lt;a href=&quot;https://www.facebook.com/makehaltomcitythriveagain/&quot; target=&quot;_blank&quot;&gt;Facebook page&lt;/a&gt;. Ron is also the founder of the Haltom United Business Alliance (HUBA) which represents existing business interests in Haltom City and promotes growth of diverse businesses as well. HUBA is not a political action committee and does not endorse candidates. If/when Ron endorses candidates, he will do so on his own with the Make Haltom City Thrive Again organization.&lt;/p&gt;','2023-04-18 14:00:00','2023-04-18 14:00:00','Hawkins City',0,'2023-04-26 05:20:44',1,'2023-04-26 10:52:53',1,0),(11,'New pressrelease','new-pressrelease','pressRelease1682487578.png','&lt;p&gt;Volunteering with The SAY Foundation is a rewarding experience that offers many benefits, including:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;The opportunity to contribute to a meaningful cause&lt;/li&gt;\r\n	&lt;li&gt;The chance to make a positive impact on the lives of PwDs&lt;/li&gt;\r\n	&lt;li&gt;The chance to gain valuable skills and experience&lt;/li&gt;\r\n	&lt;li&gt;The opportunity to meet like-minded individuals and build your network&lt;/li&gt;\r\n	&lt;li&gt;The satisfaction of giving back to your community&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Volunteer Requirements:&lt;/p&gt;\r\n\r\n&lt;p&gt;To volunteer with The SAY Foundation, you must meet the following requirements:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Be 18 years of age or older&lt;/li&gt;\r\n	&lt;li&gt;Be passionate about disability rights and inclusion&lt;/li&gt;\r\n	&lt;li&gt;Be willing to commit to a minimum of 10 hours per month&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Ways to Volunteer:&lt;/p&gt;\r\n\r\n&lt;p&gt;We offer several ways to volunteer with SAY Foundation:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Volunteer at Events:&lt;/strong&gt;&amp;nbsp;We organize various events throughout the year, such as job fairs, skill development workshops, and awareness campaigns. Volunteers can help with event planning, set-up, registration, and other tasks.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Mentorship:&lt;/strong&gt;&amp;nbsp;We offer mentorship programs for PwDs to help them develop skills, gain confidence, and advance their careers. Volunteers can serve as mentors and offer guidance and support to our participants.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Online Volunteering:&lt;/strong&gt;&amp;nbsp;We also offer virtual volunteering opportunities that allow volunteers to contribute their skills and expertise remotely. This includes social media management, content creation, website development, and other tasks.&lt;/p&gt;','2023-04-27 11:08:00','yeryeyey',NULL,0,'2023-04-26 05:39:38',1,NULL,0,0);
