CREATE TABLE `m_user_master` (
  `userId` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `fullName` varchar(128) NOT NULL,
  `gender` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '1 = Male, 2= Female, 3= Other',
  `DOB` date DEFAULT NULL,
  `image` varchar(128) DEFAULT NULL,
  `phoneNo` varchar(16) DEFAULT NULL,
  `extension` varchar(8) DEFAULT NULL,
  `mobileNo` varchar(16) DEFAULT NULL,
  `emailId` varchar(128) NOT NULL,
  `address` varchar(512) DEFAULT NULL,
  `companyName` varchar(128) DEFAULT NULL,
  `tinUserType` tinyint(2) NOT NULL DEFAULT '0' COMMENT '1 = ADMIN, 2 = EMPLOYER, 3 = EMPLOYEE,4=PARTNER',
  `loginId` varchar(32) NOT NULL,
  `password` varchar(128) NOT NULL,
  `adminPrivilege` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '0-Super Admin,1-Authority, 2-employer, 3-employee',
  `loginType` int(10) NOT NULL DEFAULT '1' COMMENT '1=Portal, 2=Google',
  `archiveStatus` tinyint(2) unsigned NOT NULL DEFAULT '0',
  `publishStatus` tinyint(2) unsigned NOT NULL DEFAULT '0',
  `mobileVerifyFlag` tinyint(1) NOT NULL DEFAULT '0',
  `emailVerifyFlag` tinyint(1) NOT NULL DEFAULT '0',
  `createdOn` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `createdBy` int(10) unsigned DEFAULT NULL,
  `updatedOn` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updatedBy` int(10) unsigned DEFAULT NULL,
  `deletedFlag` bit(1) NOT NULL DEFAULT b'0',
  `lastLogin` datetime DEFAULT NULL,
  `otp` int(11) DEFAULT NULL,
  `register_from` int(11) DEFAULT '0' COMMENT '0 - Web, 1 - Chat Box , 2 - Mobile App',
  `registerType` tinyint(1) DEFAULT '1' COMMENT 'registerType:- 1- Portal, 2- google',
  `signMediumCertified` int(11) DEFAULT '0',
  PRIMARY KEY (`userId`)
) ENGINE=InnoDB AUTO_INCREMENT=468 DEFAULT CHARSET=latin1;
